import React, { useState } from 'react';
import { ShieldCheck, Lock, ChevronDown, CheckCircle, Star } from 'lucide-react';

const CheckoutPage = ({ cart, user }) => {
  const [step, setStep] = useState(1);
  const [rating, setRating] = useState(0);
  
  const subtotal = cart.reduce((acc, item) => acc + item.price, 0);
  const delivery = 2000;
  const total = subtotal + delivery;

  // --- STEP 1: SHIPPING & SUMMARY (Based on image_3cab3c.jpg) ---
  if (step === 1) {
    return (
      <div style={pageWrapper}>
        <div style={mainContent}>
          {/* Ship To Section */}
          <div style={sectionCard}>
            <h2 style={sectionHeader}>Ship to</h2>
            <div style={formRow}>
              <div style={inputGroup}>
                <label style={label}>Country or region</label>
                <div style={selectBox}>Rwanda <ChevronDown size={16}/></div>
              </div>
            </div>
            
            <div style={formRow}>
              <input style={inputHalf} placeholder="First name" />
              <input style={inputHalf} placeholder="Last name" />
            </div>

            <div style={formRow}>
              <input style={inputFull} placeholder="Street address" />
            </div>

            <div style={formRow}>
              <input style={inputThird} placeholder="City" />
              <input style={inputThird} placeholder="State/Province/Region" />
              <input style={inputThird} placeholder="ZIP code" />
            </div>

            {/* Rwanda Phone Input */}
            <div style={formRow}>
              <div style={phoneWrapper}>
                <div style={countryCode}>
                  <img src="https://flagcdn.com/w20/rw.png" alt="RW" width="20"/>
                  <span>+250</span>
                  <ChevronDown size={14}/>
                </div>
                <input style={phoneInput} placeholder="Phone number (required)" />
              </div>
            </div>
            <p style={helperText}>We only use this number if there's a shipping issue.</p>
            
            <button style={doneBtn} onClick={() => setStep(2)}>Done</button>
          </div>

          {/* Pay With Section (Placeholder) */}
          <div style={sectionCardGray}>
            <h2 style={{...sectionHeader, color: '#999'}}>Pay with</h2>
          </div>
        </div>

        {/* SIDEBAR: Order Summary */}
        <div style={sidebar}>
          <div style={summaryCard}>
            <h2 style={summaryTitle}>Order Summary</h2>
            <div style={summaryRow}>
              <span>Item ({cart.length})</span>
              <span>RWF {subtotal.toLocaleString()}</span>
            </div>
            <hr style={divider} />
            <div style={totalRow}>
              <span>Order total</span>
              <span>RWF {total.toLocaleString()}</span>
            </div>
            
            <button style={confirmBtn} onClick={() => setStep(3)}>Confirm and pay</button>
            
            <div style={protectionBox}>
              <ShieldCheck size={20} color="#0053a0" />
              <span>Purchase protected by <b>MegaMart Money Back Guarantee</b></span>
            </div>
          </div>
        </div>
      </div>
    );
  }

  // --- STEP 3: SUCCESS & RATING ---
  return (
    <div style={successContainer}>
      <CheckCircle size={80} color="#28a745" />
      <h1>Order Confirmed!</h1>
      <div style={ratingBox}>
        <h3>Rate your experience</h3>
        <div style={{ display: 'flex', justifyContent: 'center', gap: '10px' }}>
          {[1, 2, 3, 4, 5].map(s => (
            <Star key={s} fill={rating >= s ? "#ffc107" : "none"} color="#ffc107" onClick={() => setRating(s)} style={{cursor:'pointer'}}/>
          ))}
        </div>
      </div>
    </div>
  );
};

// --- STYLES (Matching image_3ca39d.jpg & image_3cab3c.jpg) ---
const pageWrapper = { display: 'flex', gap: '40px', padding: '40px 10%', backgroundColor: '#fff', minHeight: '100vh' };
const mainContent = { flex: 2 };
const sidebar = { flex: 1 };

const sectionCard = { borderBottom: '1px solid #eee', paddingBottom: '30px', marginBottom: '30px' };
const sectionCardGray = { opacity: 0.5 };
const sectionHeader = { fontSize: '24px', fontWeight: '600', marginBottom: '20px' };

const formRow = { display: 'flex', gap: '12px', marginBottom: '15px' };
const inputGroup = { display: 'flex', flexDirection: 'column', width: '50%' };
const label = { fontSize: '13px', color: '#707070', marginBottom: '5px' };
const selectBox = { padding: '12px', border: '1px solid #cbcbcb', borderRadius: '8px', display: 'flex', justifyContent: 'space-between', alignItems: 'center' };

const inputFull = { width: '100%', padding: '15px', borderRadius: '8px', border: '1px solid #cbcbcb' };
const inputHalf = { width: '50%', padding: '15px', borderRadius: '8px', border: '1px solid #cbcbcb' };
const inputThird = { width: '33.3%', padding: '15px', borderRadius: '8px', border: '1px solid #cbcbcb' };

const phoneWrapper = { display: 'flex', border: '1px solid #cbcbcb', borderRadius: '8px', overflow: 'hidden', width: '60%' };
const countryCode = { display: 'flex', alignItems: 'center', gap: '8px', padding: '0 15px', backgroundColor: '#f7f7f7', borderRight: '1px solid #cbcbcb' };
const phoneInput = { flex: 1, border: 'none', padding: '15px', outline: 'none' };
const helperText = { fontSize: '12px', color: '#707070', marginTop: '-10px' };

const doneBtn = { backgroundColor: '#005efd', color: 'white', padding: '12px 40px', borderRadius: '25px', border: 'none', fontWeight: 'bold', marginTop: '20px', cursor: 'pointer' };

const summaryCard = { padding: '20px', border: '1px solid #eee', borderRadius: '12px' };
const summaryTitle = { fontSize: '22px', marginTop: 0 };
const summaryRow = { display: 'flex', justifyContent: 'space-between', margin: '15px 0' };
const totalRow = { display: 'flex', justifyContent: 'space-between', fontWeight: 'bold', fontSize: '18px', margin: '20px 0' };
const divider = { border: 'none', borderTop: '1px solid #eee' };
const confirmBtn = { width: '100%', padding: '15px', backgroundColor: '#cccccc', color: 'white', border: 'none', borderRadius: '25px', fontWeight: 'bold', fontSize: '16px' };

const protectionBox = { display: 'flex', gap: '10px', marginTop: '20px', fontSize: '13px', color: '#333', lineHeight: '1.4' };
const successContainer = { textAlign: 'center', padding: '100px' };
const ratingBox = { marginTop: '30px' };

export default CheckoutPage;
